package com.xgdfin.domain;import java.io.Serializable;import java.util.StringJoiner;/** Copyright (C) 2017  ShenZhen xinLianZhengXin Co.,Ltd All Rights Reserved.* 未经本公司正式书面同意，其他任何个人、团体不得使用、复制、修改或发布本软件.* 版权所有深圳市信联征信有限公司 http://www.credlink.com/*/public class User implements Serializable {    private static final long serialVersionUID = 2663770721987292194L;    private String name;    private Integer age;    private String phone;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Integer getAge() {        return age;    }    public void setAge(Integer age) {        this.age = age;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    @Override    public String toString() {        return new StringJoiner(", ", User.class.getSimpleName() + "[", "]")                .add("name='" + name + "'")                .add("age=" + age)                .add("phone='" + phone + "'")                .toString();    }}